import React from "react"
import Header from "./Components/Header"

export default function App(){

  fetch('http://example.com/movies.json')
  .then((response) => {
    return response.json();
  })
  .then((myJson) => {
    console.log(myJson);
  });

  console.log("Laba diena")

  return (
      <div>
        <Header />
      </div>
  )
}
